import React, { useState } from 'react';
import { Router, Link } from "@reach/router";
import { LinkButton } from '../styles/Link'
import styled from 'styled-components'

var AdjustHome = styled.div`
    display: flex;
    justify-content: center;
    margin-top: 10em;
    // width: 100%;
`;

var HomeContainer = styled.div`
    display: flex;
    flex-flow: column;
    justify-content: space-between;

    width: 50%;

`;

var Home = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <AdjustHome>
            <HomeContainer>
                <LinkButton to="csv">Csv Generation</LinkButton>
                <LinkButton to="config">Config Generation</LinkButton>
            </HomeContainer>
        </AdjustHome >
    );
}

export { Home };
